import React from 'react';
import Moscow from '../../images/banners/moscow_new_001.png'
import ''
const BannerImage = () => {
    return (
       <section className="banner-image">
           <figure className="banner-image__container">
               <img className="banner-image__image" src={Moscow} alt="moscow"/>
           </figure>
       </section>
    );
};

export default BannerImage;
